import logo from "./logo.svg";
import { data1 } from "./Data/1.js";
import "./App.css";
import { useEffect } from "react";

function App() {
  console.log(data1);

  const test = () => {
    data.readFile("1.txt", (err, data) => {
      if (err) throw err;

      console.log(data.toString());
    });
  };

  return <div className="App">{test()}</div>;
}

export default App;
